import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <div className="text">
      <h1>Nrithya Parichay</h1> 
      <p>"Unleashing the Beauty of Movement"</p>
      </div>
    </div>
  );
};

export default Home;
